import React from 'react';
import Books from './books'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

const Main: React.FC = () => {
    return(
        <div className="main">
            This ig Main Page!
            <div>
                <a href="./">На главную</a>
                <ul>
                    <li><Route path="/main/books" children={()=><a>This is page for Books</a>} /></li>
                    <li><Route path="/main/noutBooks" children={()=><a>This is page for NoutBooks</a>} /></li>
                </ul>
            </div>
        </div>
    )
}
export default Main;
